def powers_of_things(base):
    pows=[]
    for n in range(2,101):
        k=1
        pow=base
        while k<n:
            k+=1
            pow*=base
            if k==n:
              pows.append([pow,f"n={n}"])   
    return pows

def identify_criminals(criminal_bases):
    pow_of_things=[]
    print("tmp")
    for base in criminal_bases:
        tmp=powers_of_things(base)

        pow_of_things.append(tmp) 
    return pow_of_things

def dictionary_of_powers(dupli:dict,powers_of_two_powers:list):
    for power in powers_of_two_powers:
        print(powers_of_two_powers)
        if power[0] not in dupli.keys():
            dupli[power[0]]=1
        elif power[0] in dupli.keys():
            dupli[power[0]]+=1 
    return dupli
    

            
def dictionary_of_duplicates(powers_of_things:list):
    dupli={}
    for thing in powers_of_things:
        dupli=dictionary_of_powers(dupli,thing)
    return dupli
            
def small_calculations(sum_of_terms,duplicates):
    number_of_duplicates=len(duplicates.keys())
    sum_of_duplicates=sum(duplicates.values())
    # print(number_of_duplicates,sum_of_duplicates)
    total_removals=sum_of_duplicates-number_of_duplicates
    terms=sum_of_terms-total_removals
    return terms
def  distinct_powers(sum_of_terms,criminal_bases):
     powers_of_criminals=identify_criminals(criminal_bases)
     dupli_dic=dictionary_of_duplicates(powers_of_criminals)
     distinct_terms=small_calculations(sum_of_terms,dupli_dic)
     return distinct_terms
 
